(function(){const allowedDomains=['www.help-doc.top','help-doc.top','h0308.github.io','localhost','127.0.0.1'];function validateDomain(){const currentDomain=window.location.hostname;if(currentDomain.includes('localhost')||currentDomain.includes('127.0.0.1')){return;}
const isAllowed=allowedDomains.some(domain=>currentDomain===domain||currentDomain.endsWith('.'+domain));if(!isAllowed){window.location.href=`https://www.help-doc.top${window.location.pathname}`;}}
if(document.readyState==='loading'){document.addEventListener('DOMContentLoaded',()=>setTimeout(validateDomain,1000));}else{setTimeout(validateDomain,1000);}
if(window.top!==window.self){window.top.location.href=window.self.location.href;}})();